import React from 'react';
import ReactDOM from 'react-dom';
import {
    BrowserRouter as Router,
    Route,
    Link,
    Switch
} from 'react-router-dom';

import {
    Title
} from './components';

const App = () => {
    return (
        <Router>
            <Title />
        </Router>
    );
}

ReactDOM.render(
    <App />,
    document.getElementById('root')
);
